@tomwe @bintykins @chao_xian @tygertale In my defence I hope I made it clear that I just didn’t get it :-)

It just made me feel old. It reminds me of when I played Rage against the Machine to my dad and he said “But it’s just noise &amp; shouting”. 

Oh god. I’ve become my dad....

@NeolithicSheep Maybe this will bring Twitter's rage down on me like pineapple on pizza, but I brew one pot n the morning from fresh ground beans, make sure it's not left on heat afterwards. 

And then I can get a small cup and heat it up serveral times during the day.

But I also like p-on-p...
